Lonely Planet Madagascar is your passport to all the most relevant and up-to-date advice on what to see, what to skip, and what hidden discoveries await you.

Spend a night under the stars on the Imarivolanitra Trail, nestle in a hammock at Chez Sika, or see the majestic baobabs during sunset; all with your trusted travel companion. Get to the heart of Madagascar and begin your journey now!
